import React from 'react';
import Navbar from '../nav/Navbar';

function Header() {
    return (
        <>
            <div className="container" >
                <div className="row">

                    <div className="col">
                        logo of the weather inoun fund in the position
                    </div>
                    <div className="col">
                        <Navbar />
                    </div>
                </div>

            </div></>);
}

export default Header;
